	jet_1_nsymb_taylor_rho = nsymbs;
	mycoef_initup();
	myfloat_init(jet_1_faux_taylor_rho);
	mycoef_init(jet_1_caux_taylor_rho);
	jet_1_flag_init_jet_library_taylor_rho=1;
